import Layout from '../components/Layout';
import Private from '../components/auth/Private';
import Main from '../components/Main';
import Sidebar from '../components/Sidebar';

const Index = () => {
    return (
        <Private>
            <Layout>
                <div className='app'>
                    <div className='app__body'>
                    <Sidebar />
                        <Main />
                    </div>
                </div>
            </Layout>
        </Private>
    );
}

export default Index;
